  {
    axios.get('http://localhost:9090/wishlist/getAll').then(res=>{setWishlist()})
  }

  return (
    <div className='bg-dark text-light'>
      <div className='container'>
        <h1 className='text-center pt-3'>Wishn List Items</h1>
        
      </div>
    </div>
  )
}

